#include "precompilerdefinitions"
module quadratures_stencils
    !! Return quadrature points and weights for integrals, and stencil points and weights for derivatives
    use konstanter, only: flyt,lo_exitcode_param
    use gottochblandat, only: lo_stop_gracefully,tochar
    implicit none

    private
    public :: lo_gaussianquadrature
    public :: lo_centraldifference
    public :: lo_3D_centraldifference
    
contains

!> 3D central difference schemes. Not sure if actually good.
subroutine lo_3D_centraldifference(n,x0,h,sc)
