    sc=0.0_flyt
    select case(n)
    case(2)
        ! u,v,w,du,dv,dw,duu,duv,duw,dvv,dvw,dww
        sc(1,:)=[-1.0_flyt, -1.0_flyt, -1.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt];
