        sc(5,:)=[-1.0_flyt, 0.0_flyt, 0.0_flyt, -5.000000000000000e-1_flyt, 0.0_flyt, 0.0_flyt, 1.000000000000000_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt];
        sc(6,:)=[-1.0_flyt, 0.0_flyt, 1.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, -2.500000000000000e-1_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt];
        sc(7,:)=[-1.0_flyt, 1.0_flyt, -1.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt];
        sc(8,:)=[-1.0_flyt, 1.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, -2.500000000000000e-1_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt];
