        sc(18,:)=[0.0_flyt, 1.0_flyt, 1.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 2.500000000000000e-1_flyt, 0.0_flyt];
        sc(19,:)=[1.0_flyt, -1.0_flyt, -1.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt];
        sc(20,:)=[1.0_flyt, -1.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, -2.500000000000000e-1_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt, 0.0_flyt];
