!> Central difference rules up to pretty high order
subroutine lo_centraldifference(n,x0,h,sc)
    !> order of stencil
    integer, intent(in) :: n
    !> point to differentiate around
    real(flyt), intent(in) :: x0
    !> step
    real(flyt), intent(in) :: h
    !> abscissas and weights. Should be dimension (2*n+1,4), where the columns are abscissa, and weights for 1st,2nd and 3rd derivatives
    real(flyt), dimension(:,:), intent(out) :: sc

    sc=0.0_flyt
    select case(n)
    case(1)
        sc(1,:)=[-1.0_flyt,-0.50000000000000_flyt, 1.0000000000000_flyt,0.0_flyt];
        sc(2,:)=[ 0.0_flyt, 0.0_flyt,              -2.0000000000000_flyt,0.0_flyt];
        sc(3,:)=[ 1.0_flyt, 0.50000000000000_flyt, 1.0000000000000_flyt,0.0_flyt];
    case(2)
        sc(1,:)=[-2.0_flyt, 8.333333333333333e-2_flyt, -8.333333333333333e-2_flyt, -5.000000000000000e-1_flyt];
        sc(2,:)=[-1.0_flyt, -6.666666666666667e-1_flyt, 1.333333333333333_flyt, 1.000000000000000_flyt];
        sc(3,:)=[0.0_flyt, 0.0_flyt, -2.500000000000000_flyt, 0.0_flyt];
        sc(4,:)=[1.0_flyt, 6.666666666666667e-1_flyt, 1.333333333333333_flyt, -1.000000000000000_flyt];
        sc(5,:)=[2.0_flyt, -8.333333333333333e-2_flyt, -8.333333333333333e-2_flyt, 5.000000000000000e-1_flyt];
    case(3)
        sc(1,:)=[-3.0_flyt, -1.666666666666667e-2_flyt, 1.111111111111111e-2_flyt, 1.250000000000000e-1_flyt];
        sc(2,:)=[-2.0_flyt, 1.500000000000000e-1_flyt, -1.500000000000000e-1_flyt, -1.000000000000000_flyt];
