        sc(5,:)=[1.0_flyt, 7.500000000000000e-1_flyt, 1.500000000000000_flyt, -1.625000000000000_flyt];
        sc(6,:)=[2.0_flyt, -1.500000000000000e-1_flyt, -1.500000000000000e-1_flyt, 1.000000000000000_flyt];
        sc(7,:)=[3.0_flyt, 1.666666666666667e-2_flyt, 1.111111111111111e-2_flyt, -1.250000000000000e-1_flyt];
    case(4)
