        sc(3,:)=[-2.0_flyt, 2.000000000000000e-1_flyt, -2.000000000000000e-1_flyt, -1.408333333333333_flyt];
        sc(4,:)=[-1.0_flyt, -8.000000000000000e-1_flyt, 1.600000000000000_flyt, 2.033333333333333_flyt];
