        sc(2,:)=[-5.0_flyt, -2.597402597402597e-3_flyt, 1.038961038961039e-3_flyt, 2.261904761904762e-2_flyt];
        sc(3,:)=[-4.0_flyt, 1.785714285714286e-2_flyt, -8.928571428571429e-3_flyt, -1.530952380952381e-1_flyt];
        sc(4,:)=[-3.0_flyt, -7.936507936507937e-2_flyt, 5.291005291005291e-2_flyt, 6.572751322751323e-1_flyt];
        sc(5,:)=[-2.0_flyt, 2.678571428571429e-1_flyt, -2.678571428571429e-1_flyt, -1.995089285714286_flyt];
