    end select
    ! Now adjust it to the interval we care about
    sc(:,1)=sc(:,1)*h+x0
    sc(:,2)=sc(:,2)/h
    sc(:,3)=sc(:,3)/h**2
    sc(:,4)=sc(:,4)/h**3
end subroutine

